auto dijkstra(const Edges<D> &E, int s) { int n = E.size(); std::vector<D> dis(n, std::numeric_limits<D>::max() / 2); std::vector<int> from(n, -1); std::vector<bool> vis(n); dis[s] = 0, from[s] = s; using pdi = std::pair<D, int>; std::priority_queue<pdi, std::vector<pdi>, std::greater<pdi>> pq; pq.emplace(0, s); while (!pq.empty()) { auto [w, u] = pq.top(); pq.pop(); if (vis[u]) continue; vis[u] = true; for (auto [v, wi] : E[u]) { D d2 = w + wi; if (dis[v] > d2) dis[v] = d2, from[v] = u, pq.emplace(d2, v); } } return make_pair(dis, from);
